import React from "react";
import { ClipboardList } from "lucide-react";

const OrderHistory = ({ clickCount }) => {
  return (
    <div className="order-history">
      <ClipboardList />
      <h5>View Orders</h5>
      <p style={{ color: "red", fontWeight: "bold", fontSize: "12px" }}>
        {clickCount}
      </p>
    </div>
  );
};

export default OrderHistory;
